function wordWrap(str, maxWidth) {
    var newLineStr = "\n"; done = false; res = '';
    while (str.length > maxWidth) {                 
        found = false;
        // Inserts new line at first whitespace of the line
        for (i = maxWidth - 1; i >= 0; i--) {
            if (testWhite(str.charAt(i))) {
                res = res + [str.slice(0, i), newLineStr].join('');
                str = str.slice(i + 1);
                found = true;
                break;
            }
        }
        // Inserts new line at maxWidth position, the word is too long to wrap
        if (!found) {
            res += [str.slice(0, maxWidth), newLineStr].join('');
            str = str.slice(maxWidth);
        }

    }

    return res + str;
}

function testWhite(x) {
    var white = new RegExp(/^\s$/);
    return white.test(x.charAt(0));
};


function checkInput(supplier, nomeFornecedor, order, comment, articleReference, boxesPerPallet, numberOfPallets, numberOfFirstPallet, numberOfTableLines){

	if(is_int(supplier)==false || isValidChar(order)==false){
		alert("Por Favor, insira um cdigo do fornecedor e/ou o nmero da encomenda vlido!\n\nPlease fill out the data. A valid supplier number and number of order are required!");
		return false
	}

	if(nomeFornecedor==null || nomeFornecedor==""){
		alert("O nome do fornecedor  de preenchimento obrigatrio.")
		return false;
	}

	if(numberOfTableLines==0){
		alert("Os dados na tabela da descrio esto incompletos ou so invlidos.\n\nComece por preencher as linhas de cima para baixo \n e preencha os dados de cada linha completamente.")
		return false;
	}

	for(var i=0;i<numberOfTableLines;i++){
		if(isValidChar(articleReference[i])==false || is_int(boxesPerPallet[i])==false || is_int(numberOfPallets[i])==false || is_int(numberOfFirstPallet[i])==false){
			alert("Dados incompletos ou invlidos na descriminao da encomenda!\nDeve preencher a linha "+(i+1)+ " na tabela da descrio.\n\n As linhas devem ser preenchidas por ordem comeando na primeira linha.");
			return false;
		}	
	}

	for(var i=0;i<numberOfTableLines;i++){	
			if (articleReference[i].length < 3){alert("Nmero de caracteres invlido na referncia do artigo !\n The length of the article reference is invalid !");
				return false;
			}
	}

	for(var i=0;i<numberOfTableLines;i++){	
			if(boxesPerPallet[i]<1) {alert("Nmero de caracteres invlido nas caixas por palete !\n The length of  boxes per pallet is invalid !");return false;}
			if(numberOfPallets[i]<1) {alert("Nmero de caracteres invlido no nmero de paletes !\n The length of  number of pallets is invalid !");return false;}
	}
	return true;
}

function is_int(value){
	if(value==''){return false;}
	for (var i = 0 ; i < value.length ; i++){
		if ((value.charAt(i) < '0') || (value.charAt(i) > '9')) {return false; }
	}
	return true;
}

function isValidChar(value){
	if(value==''){return false;}
	for (var i = 0 ; i < value.length ; i++){
		if(value.match(/^[0-9a-zA-Z]+$/)){;}
		else {return false;}
	}
	return true;
}

