function convertToLT(time, UTCOrLT){
	if(convertToLT==='LT'){
		return time;
	}else{
		var offset= new Date().getTimezoneOffset()*60*1000;
		var ltTime = parseInt(time.substr(0,2)) - offset/3600000 + time.substr(2,3);
		return ltTime;
	}
}

